import React from 'react';
import '../styles/TopBar.css';
//import logo from '../public/tiktokstudiologo-removebg-preview.png'; // Adjust the path according to your directory structure
function TopBar() {
  return (
    <div className="top-bar">
      <div className="logo">
        <img src='tiktokstudiologo-removebg-preview.png' alt="TikTok Studio Logo" />
      </div>
      <div className="user-profile">
        <img src="https://via.placeholder.com/40" alt="User Profile" className="profile-pic" />
      </div>
    </div>
  );
}

export default TopBar;
